// External Imports
import React from 'react';

// Internal Imports
import StackedAreaGraph from '../Graphs/StackedAreaGraph';
import BubbleGraph from '../Graphs/BubbleGraph';
import './StoryboardContainer.css';

const StoryboardContainer = () => {
  return (
    <div className='positioning-experiment'>
      <div className='bg-black full-height-container'></div>
      <div className='bg-blue full-height-container'>
        <StackedAreaGraph />
      </div>
      <BubbleGraph />
      <div className='bg-blue full-height-container'></div>
      <div className='bg-blue full-height-container'></div>
      <div className='bg-black full-height-container'></div>
      <div className='bg-grey full-height-container'></div>
      <div className='bg-grey full-height-container'></div>
      <div className='bg-grey full-height-container'></div>
      <div className='bg-black full-height-container'></div>
      <div className='bg-white full-height-container'></div>
      <div className='bg-white full-height-container'></div>
      <div className='bg-white full-height-container'></div>
      <div className='bg-black full-height-container'></div>
    </div>
  );
};

export default StoryboardContainer;
